<p class="western" align="center" style="margin-bottom: 0.35cm; line-height: 115%">
<font size="4" style="font-size: 16pt"><b>CÉLULAS</b></font></p>
<p class="western" align="center" style="margin-bottom: 0.35cm; line-height: 115%">
<br><br>
</p>
<p class="western" style="margin-bottom: 0.35cm; line-height: 115%"><a name="_GoBack"></a>
<font size="4" style="font-size: 14pt">Cada igreja utiliza uma forma
de gerenciamento e supervisão das células, então o nosso sistema
permite que essas configurações sejam feitas de acordo com a
necessidade de cada uma. Vamos aprender como se faz!</font></p>
<p class="western" style="margin-bottom: 0.35cm; line-height: 115%"><br><br>
</p>
<p class="western" style="margin-bottom: 0.35cm; line-height: 115%"><font size="4" style="font-size: 14pt"><b>Passo
1: </b></font><font size="4" style="font-size: 14pt">No menu lateral,
acesse a aba “Células”. Após cadastrar informações, você
verá nesta página algumas estatísticas geradas pelas informações
no sistema.</font></p>
<p class="western" style="margin-bottom: 0.35cm; line-height: 115%"><img src="data:image/png;base64," name="Picture" align="bottom" width="1285" height="604" border="0"></p>
<p class="western" style="margin-bottom: 0.35cm; line-height: 115%"><br><br>
</p>
<p class="western" style="margin-bottom: 0.35cm; line-height: 115%"><font size="4" style="font-size: 14pt"><b>Passo
2:</b></font><font size="4" style="font-size: 14pt"> Na opção
“Configurações” do menu, clique em “Alterar” a Configuração
Padrão para gerenciar os níveis de estrutura da célula.</font></p>
<p class="western" style="margin-bottom: 0.35cm; line-height: 115%"><font size="4" style="font-size: 14pt">(*Caso
sua igreja não utilize níveis estruturais para as células, pule
para o </font><font size="4" style="font-size: 14pt"><b>Passo 4</b></font><font size="4" style="font-size: 14pt">.)</font></p>
<p class="western" style="margin-bottom: 0.35cm; line-height: 115%"><img src="data:image/png;base64," name="Imagem1" align="bottom" width="1285" height="604" border="0"></p>
<p class="western" style="margin-bottom: 0.35cm; line-height: 115%"><br><br>
</p>
<p class="western" style="margin-bottom: 0.35cm; line-height: 115%"><font size="4" style="font-size: 14pt">Note
que os níveis já foram preenchidos automaticamente, mas é apenas
uma sugestão do sistema.</font></p>
<p class="western" style="margin-bottom: 0.35cm; line-height: 115%"><br><br>
</p>
<p class="western" style="margin-bottom: 0.35cm; line-height: 115%"><img src="data:image/png;base64," name="Imagem2" align="bottom" width="1285" height="604" border="0"></p>
<p class="western" style="margin-bottom: 0.35cm; line-height: 115%"><font size="4" style="font-size: 14pt"><b>OBS.:</b></font><font size="4" style="font-size: 14pt">
Caso sua igreja não utilize uma estrutura com 5 níveis, mantenha os
nomes dos primeiros níveis já sugeridos pelo sistema ou use títulos
genéricos.  (Por exemplo: caso sua igreja só utilize 2 níveis,
edite apenas os níveis IV e V e mantenha nomes genéricos para os
outros).</font></p>
<p class="western" style="margin-bottom: 0.35cm; line-height: 115%"><br><br>
</p>
<p class="western" style="margin-bottom: 0.35cm; line-height: 115%"><font size="4" style="font-size: 14pt"><b>Passo
3:</b></font><font size="4" style="font-size: 14pt"> Após salvar a
estrutura, clique novamente em “Células” e depois em
“Estruturas”. Note que o sistema apresenta os níveis de acordo
com o que você salvou.</font></p>
<p class="western" style="margin-bottom: 0.35cm; line-height: 115%"><img src="data:image/png;base64," name="Imagem3" align="bottom" width="1285" height="604" border="0"></p>
<p class="western" style="margin-bottom: 0.35cm; line-height: 115%"><br><br>
</p>
<p class="western" style="margin-bottom: 0.35cm; line-height: 115%"><font size="4" style="font-size: 14pt">A
partir de agora, é só começar a cadastrar, começando com o nível
1. Caso ninguém esteja estipulado especificamente para a posição,
use um nome genérico, como no exemplo. Caso contrário, busque pelo
nome da pessoa.</font></p>
<p class="western" style="margin-bottom: 0.35cm; line-height: 115%"><br><br>
</p>
<p class="western" style="margin-bottom: 0.35cm; line-height: 115%"><img src="data:image/png;base64," name="Imagem4" align="bottom" width="1285" height="603" border="0"></p>
<p class="western" style="margin-bottom: 0.35cm; line-height: 115%"><br><br>
</p>
<p class="western" style="margin-bottom: 0.35cm; line-height: 115%"><font size="4" style="font-size: 14pt">Nos
níveis seguintes, você sempre precisará associar alguém do nível
acima, para formar a estrutura que depois você usará para a célula.</font></p>
<p class="western" style="margin-bottom: 0.35cm; line-height: 115%"><br><br>
</p>
<p class="western" style="margin-bottom: 0.35cm; line-height: 115%"><img src="data:image/png;base64," name="Imagem5" align="bottom" width="1285" height="603" border="0"></p>
<p class="western" style="margin-bottom: 0.35cm; line-height: 115%"><br><br>
</p>
<p class="western" style="margin-bottom: 0.35cm; line-height: 115%"><font size="4" style="font-size: 14pt"><b>Passo
4:</b></font><font size="4" style="font-size: 14pt"> Depois de
cadastrar os cinco níveis estruturais, clique em “Nova Célula”
em “Células” no menu lateral e comece a cadastrar. Para as
igrejas que usam a estrutura em níveis: selecione o nível
sinalizado abaixo em vermelho e todo o resto da estrutura irá
aparecer. Caso sua célula tenha vínculos com outras, acesse a aba
sinalizada abaixo em laranja e estabeleça esses vínculos.</font></p>
<p class="western" style="margin-bottom: 0.35cm; line-height: 115%"><img src="data:image/png;base64," name="Imagem6" align="bottom" width="1284" height="603" border="0"></p>
<p class="western" style="margin-bottom: 0.35cm; line-height: 115%"><font size="4" style="font-size: 14pt"><u><b>OBS.:
</b></u></font><font size="4" style="font-size: 14pt">A utilização
de níveis para o cadastro de células não é obrigatório.</font></p>
<p class="western" style="margin-bottom: 0.35cm; line-height: 115%"><br><br>
</p>
<p class="western" style="margin-bottom: 0.35cm; line-height: 115%"><font size="4" style="font-size: 14pt">Após
preencher as informações da célula, você terá duas opções para
gravar: a primeira irá apenas gravar a célula e a outra irá te
direcionar automaticamente para a tela de cadastro de participantes.
Caso você opte por apenas gravar a célula, você poderá acessar
esta tela depois através de “Participantes” em “Células” no
menu lateral.</font></p>
<p class="western" style="margin-bottom: 0.35cm; line-height: 115%"><br><br>
</p>
<p class="western" style="margin-bottom: 0.35cm; line-height: 115%"><img src="data:image/png;base64," name="Imagem7" align="bottom" width="1285" height="603" border="0"></p>
<p class="western" style="margin-bottom: 0.35cm; line-height: 115%"><br><br>
</p>
<p class="western" style="margin-bottom: 0.35cm; line-height: 115%"><font size="4" style="font-size: 14pt"><b>Passo
5: </b></font><font size="4" style="font-size: 14pt">Clique em
“Incluir Participante(s) em uma Célula” e você será
direcionado para a tela abaixo. Clique na lupa e após localizar a
pessoa desejada, clique no botão azul para incluir. Faça isso até
incluir todos os integrantes e então salve. </font>
</p>
<p class="western" style="margin-bottom: 0.35cm; line-height: 115%"><img src="data:image/png;base64," name="Imagem8" align="bottom" width="1285" height="602" border="0"></p>
<p class="western" style="margin-bottom: 0.35cm; line-height: 115%"><br><br>
</p>
<p class="western" style="margin-bottom: 0.35cm; line-height: 115%"><font size="4" style="font-size: 14pt"><b>Passo
6:</b></font><font size="4" style="font-size: 14pt"> Caso futuramente
um participante de uma célula passe a frequentar outra célula,
acesse “Movimentação Membros” em “Células” e selecione
“Nova Movimentação”. Nesta tela, preencha os campos e então
selecione a célula atual e a nova célula. Todos os participantes da
Célula Atual irão aparecer. Selecione quem irá mudar de célula e
faça a transferência. Dessa forma, a movimentação do membro
aparecerá em sua Linha do Tempo e em seu Histórico de Movimentações
no cadastro de Pessoas.</font></p>
<p class="western" style="margin-bottom: 0.35cm; line-height: 115%"><img src="data:image/png;base64," name="Imagem9" align="bottom" width="1069" height="502" border="0"></p>
<p class="western" style="margin-bottom: 0.35cm; line-height: 115%"><font size="4" style="font-size: 14pt"><u><b>OBS.:</b></u></font><font size="4" style="font-size: 14pt">
Para selecionar mais de uma pessoa, segure a tecla    e clique nas
pessoas a serem transferidas.</font></p>
<p class="western" style="margin-bottom: 0.35cm; line-height: 115%"><br><br>
</p>
<p class="western" style="margin-bottom: 0.35cm; line-height: 115%"><font size="4" style="font-size: 14pt">Depois
de cadastrados os participantes, está tudo pronto para que você
comece a gerenciar os encontros de célula. Essa função pode ser
realizada por um usuário com essa permissão no sistema e até mesmo
pelos líderes de cada célula. Acesse o tutorial “Gerenciamento de
Encontros da Célula” em “Ajuda/Documentação” no menu lateral
para entender certinho como funciona essa parte.</font></p>
<p class="western" style="margin-bottom: 0.35cm; line-height: 115%"><br><br>
</p>
<p class="western" style="margin-bottom: 0.35cm; line-height: 115%"><br><br>
</p>
<p class="western" style="margin-bottom: 0.35cm; line-height: 115%"><font color="#ff0000"><font size="4" style="font-size: 14pt"><u><b>DICA</b></u></font></font></p>
<p class="western" style="margin-bottom: 0.35cm; line-height: 115%"><font size="4" style="font-size: 14pt">Caso
você vá cadastrar uma nova de pessoa no sistema e ela participe de
uma célula, você poderá realizar a inclusão dela na célula
direto pelo cadastro de pessoa, na aba “Dados Eclesiásticos”, na
opção “Células”.</font></p>
